import React from 'react';

const img = {
    width:'50px',
    height:'50px',
    objectFit: 'cover'
}


const Customer = ({imageBase64, isGold, name, phone}) => {
   
    return (
        <>
            <img className="img-fluid" src={require(`../../utils/images/${imageBase64}`).default}/>
            <h3>{name}</h3>
            <p>{phone}</p>
            <p>Is Gold: {isGold ? 'yes' : 'no'}</p>
        </>
    )
}

export default Customer;
